import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({tiles}) => {

  const tile = tiles.map((tile, index) => {
    let { name, ...description } = tile
    return (
      <Tile />
    )
  })
  return (
    <div>
      {tile}
    </div>
  );
};
